MGCAddSnippet(1, "Title Page");
MGCAddSnippet(2, "List of Figures");
MGCAddSnippet(3, "List of Tables");
MGCAddSnippet(4, "");
MGCAddSnippet(5, "Calibre RealTime Custom integrates flat Calibre nmDRC with supported layout design tools so that Calibre nmDRC can be run directly from the design tool. Calibre RealTime loads the complete Calibre rule file, but  check recipes  give you control over what checks are executed for each Calibre run. Calibre nmDRC is run on a selected region of the layout. If supported by the design tool, Calibre nmDRC can be run automatically on the region around a design edit. ");
MGCAddSnippet(6, "Certain requirements for the design tool, environment variables, and Calibre rule file must be met before running Calibre RealTime Custom.");
MGCAddSnippet(7, "Calibre RealTime Custom requires certain product licenses for DRC runs and highlight operations in the toolbar.");
MGCAddSnippet(8, "The Calibre RealTime Custom interface integrates flat Calibre nmDRC with supported layout design tools so that Calibre nmDRC can be run directly from the design tool. Calibre and Calibre RealTime Custom differ in run mode support, layout processing, SVRF command support, and result output. ");
MGCAddSnippet(9, "Certain terms and concepts, such as check selection recipe, halo, run configuration, and run context, are used when discussing Calibre RealTime Custom operation.");
MGCAddSnippet(10, "The command descriptions use font properties and several metacharacters to document the command syntax.");
MGCAddSnippet(11, "All integrations of Calibre RealTime Custom share some basic methodology, such as halo usage and configuration file usage. Some integrations support API control for setting options and controlling environment variables. ");
MGCAddSnippet(12, "Halos ensure that new errors caused by changes in the geometry are reported, and false errors caused by edge effects are not reported. A halo expands the area around a region selected for a DRC run so that surrounding geometries are included. Halos are used for all Calibre RealTime Custom runs. ");
MGCAddSnippet(13, "Halos ensure that new errors caused by changes in the geometry are reported, and false errors caused by edge effects are not reported. Halos are used for all Calibre RealTime Custom runs. Each time Calibre RealTime Custom runs Calibre nmDRC, a halo expands the area around the region selected for the run so that surrounding geometries are included. ");
MGCAddSnippet(14, "You may see inconsistent error reporting when Calibre RealTime is run in Run DRC on Edit mode with a small halo size. In particular, this can occur if the halo size is smaller than a spacing constraint being checked. The Run DRC on Edit mode is not available in all integrations.");
MGCAddSnippet(15, "As with other rule checks, Density checks in Calibre RealTime Custom analyze the visible region in the layout window plus a halo region or the region of the design edit plus a halo region, depending on the selection Run DRC in Window or Run DRC on Edit (if available). Although the Density results are accurate for the specific run context, the results may differ from those of a Calibre batch run or a Calibre RealTime Custom run with a different run context. ");
MGCAddSnippet(16, "Density checks may give spurious results in Calibre RealTime if they are run on a small region of the design.");
MGCAddSnippet(17, "The Calibre RealTime Options dialog box specifies the Calibre rule file, the check recipe, and other options. The settings in the Calibre RealTime Options dialog box are saved in the Calibre RealTime Configuration File. ");
MGCAddSnippet(18, "Calibre RealTime Custom can read object maps and layer maps. These files specify the mapping of database layers and objects to the GDS layer number and datatype pairs expected by the Calibre rule file. ");
MGCAddSnippet(19, "Calibre RealTime requires that layers in the design database are mapped to GDS layer number and datatype pairs for layout export; the mapping should correspond to what is expected by the Calibre rule file and any Layer Map statements within the rule file. ");
MGCAddSnippet(20, "The object map file specifies how OpenAccess database objects are mapped to GDS layer number and datatype pairs expected by the Calibre rule file. The object map file is specified in the Calibre RealTime Options dialog box. ");
MGCAddSnippet(21, "Calibre RealTime Custom run configurations, option settings, and check recipe definitions are saved in the session configuration file. The configuration file is saved automatically and named .realtime.cfg. The configuration file is saved in your home directory by default; however, you may specify a different location for the configuration file. ");
MGCAddSnippet(22, "The Calibre RealTime session configuration file is saved in your home directory by default. It can also be saved in a user-defined directory. The configuration file is named .realtime.cfg. ");
MGCAddSnippet(23, "Calibre RealTime Custom supports reading the session configuration file from a specified directory or multiple directories. If configuration files are located in multiple directories, the order of precedence is set with the environment variable MGC_REALTIME_CONFIG_DIRS. This feature allows system and project administrators to define settings for a group or project while still allowing settings to be adjusted by individual users. ");
MGCAddSnippet(24, "The MGC_REALTIME_CONFIG_DIRS environment variable specifies a list of one or more directories separated by a colon (:), where each directory contains a .realtime.cfg file. The order of precedence is from left to right, as with the Unix $PATH variable. MGC_REALTIME_CONFIG_DIRS also specifies the location of the writable session configuration file for saving updated configuration settings. ");
MGCAddSnippet(25, "You can create and define multilevel configuration files for Calibre RealTime Custom. This allows Calibre RealTime Custom to read settings from more than one configuration file. ");
MGCAddSnippet(26, "Some releases of Calibre RealTime include a syntax update for the session configuration file .realtime.cfg. If you use the environment variable MGC_REALTIME_CONFIG_DIRS to set up multiple Calibre RealTime session configuration files in different directories, the session configuration files in each directory must be updated to the new syntax.");
MGCAddSnippet(27, "Calibre RealTime Custom provides commands to control options and environment variables from the command interface of supported design tools. You can also set environment variables to specify the path to certain input files. ");
MGCAddSnippet(28, "Calibre RealTime provides commands to get and set environment variables from the command interface of supported design tools. Calibre RealTime recompiles the rule file if an environment variable changes due to one of these commands. ");
MGCAddSnippet(29, "Get the value of an environment variable. ");
MGCAddSnippet(30, "Determine if an environment variable exists in the Calibre RealTime process.");
MGCAddSnippet(31, "Set an environment variable in Calibre RealTime and the design tool environment.");
MGCAddSnippet(32, "Unset an environment variable in Calibre RealTime Custom and the design tool environment.");
MGCAddSnippet(33, "You can set the options in the Calibre RealTime Options dialog box using commands issued in supported design tools. This allows you to configure Calibre RealTime within the design environment. ");
MGCAddSnippet(34, "Add a run configuration with a specified name. ");
MGCAddSnippet(35, "Delete the run configuration with the specified name. ");
MGCAddSnippet(36, "Gets the value of a Calibre RealTime option which is independent of the run configuration. ");
MGCAddSnippet(37, "Get the name of the run configuration corresponding to the specified ID. ");
MGCAddSnippet(38, "Get the value of the specified Calibre RealTime option. In Calibre RealTime with Synopsys Laker3 and Synopsys Custom Compiler, the run configuration ID is an optional value—the value in the current run configuration is returned by default. ");
MGCAddSnippet(39, "Gets the configuration ID of the current run configuration. ");
MGCAddSnippet(40, "Save the current Calibre RealTime configuration. ");
MGCAddSnippet(41, "Set the value of a Calibre RealTime Custom option. In Calibre RealTime with Synopsys Laker3 and Synopsys Custom Compiler, the run configuration ID is an optional value—the value in the current run configuration is set by default. ");
MGCAddSnippet(42, "Set the value of a Calibre RealTime option which is independent of the run configuration. ");
MGCAddSnippet(43, "Get the version of the Tcl API. ");
MGCAddSnippet(44, "You can set environment variables to specify the path to certain input files for Calibre RealTime. The environment variables apply to all supported design tools.");
MGCAddSnippet(45, "The Calibre RealTime Custom license is checked out when you start a Calibre RealTime Custom run. You can set the timeout period for the Calibre RealTime Custom license. The license timeout period also applies to the Calibre RealTime Results window. ");
MGCAddSnippet(46, "A typical Double Patterning (DP) rule file derives layers for each mask and for the conflict and warning rings associated with a DP violation. Debugging a DP violation involves testing various possible fixes to the layout and choosing the optimum fix. This process is made easier with Calibre RealTime Custom because you can immediately see the results of a layout change. ");
MGCAddSnippet(47, "You can view results from a Calibre RealTime run in the Calibre RealTime Results window, which is similar to Calibre RVE for DRC. The window includes a tree view, a details view, a check text pane, and controls for highlighting. The Calibre RealTime Results Window is available in the integrations to Cadence Virtuoso, Synopsys Custom Compiler, and Synopsys Laker3.");
MGCAddSnippet(48, "If you use Calibre Interactive nmDRC and want to use the same options for your Calibre RealTime Custom run, you can specify the Calibre Interactive runset in the Calibre RealTime Options dialog box. Calibre RealTime Custom calls Calibre Interactive to generate the Calibre Interactive control file, and the control file is used for the Calibre RealTime Custom run. If the runset includes a customization file, the Customization GUI is opened and the settings are applied to the control file.");
MGCAddSnippet(49, "You can specify a Calibre Interactive runset instead of a rule file for a Calibre RealTime run. Calibre RealTime calls Calibre Interactive to generate the Calibre Interactive control file. The generated control file is used for the Calibre RealTime run, so that all the options set in the runset are used for the Calibre RealTime run. You can use the Calibre RealTime Options dialog box or an environment variable to specify Calibre Interactive runsets. ");
MGCAddSnippet(50, "If you use a customization file with Calibre Interactive nmDRC, you can use the same customization file with Calibre RealTime. This allows you to make customization settings at any time and apply them to your Calibre RealTime session. ");
MGCAddSnippet(51, "DRC Rule Check Comments are one way to specify the highlight color or highlight layer for Calibre RealTime Custom results. Rule check comments are supported for all tools with Calibre RealTime Custom. The rule check comments specify the highlight color or highlight layer index for a given rule check so that results from a given rule check are always highlighted in the same color.");
MGCAddSnippet(52, "You can specify DRC Rule Check comments for Calibre RealTime in a Check Text Override file (CTO file). The CTO file is specified in the Calibre RealTime Options dialog box.");
MGCAddSnippet(53, "A DRC RVE rule check comment that specifies the highlight layer index used for the rule check. ");
MGCAddSnippet(54, "A DRC RVE rule check comment that specifies the highlight layer color used for the rule check in supported layout viewers. ");
MGCAddSnippet(55, "A DRC RVE rule check comment that specifies the layers that are shown in the layout editor when highlighting a result from the rule check. ");
MGCAddSnippet(56, "A DRC RVE rule check comment which creates a hyperlink that is displayed in the check text pane of the Calibre RealTime Results window for the rule check. ");
MGCAddSnippet(57, "The check text override file (CTO file) allows you to specify DRC RVE rule check comments for a Calibre RealTime run without editing the rule file. DRC RVE rule check comments can specify the highlight color or the highlight layer index for errors found during a Calibre RealTime run.");
MGCAddSnippet(58, "Calibre RealTime Custom uses a Check Selection Recipe to define the rule checks that are executed during the run. A number of built-in check recipes are provided, and you can define your own user-defined check recipes.");
MGCAddSnippet(59, "A check recipe is a set of rules for selecting the checks to execute for a Calibre RealTime run. Calibre RealTime Custom defines a set of built-in check recipes, and you can create custom check recipes.");
MGCAddSnippet(60, "The check recipe selects which rule checks are executed during the Calibre RealTime run.");
MGCAddSnippet(61, "Calibre RealTime includes several built-in check selection recipes. These built-in check recipes include commonly used check selections, such as  Checks selected in the rules file ,  All checks , and  Visible layer checks.  ");
MGCAddSnippet(62, "You can use the environment variable MGC_CALIBRE_HIDDEN_RECIPES to hide specified built-in check recipes. Hidden check recipes do not appear in the dropdown list of check recipes in the toolbar, in the Calibre RealTime Options dialog box, or in the Calibre RealTime Recipe editor. ");
MGCAddSnippet(63, "Custom check recipes (also called user recipes) enable you to control the Calibre rule checks that are executed during a Calibre nmDRC run. You can create a new custom check recipe or start by copying an existing recipe. ");
MGCAddSnippet(64, "The basic editing controls in the Calibre RealTime Recipe editor dialog box allow you to construct check recipes based on a short list of common expressions, such as  Checks selected in the rule file  and  Checks with density . You can also include and exclude individual checks and check groups. ");
MGCAddSnippet(65, "The advanced editing controls in the Recipe Editor allow you to select checks by layer, select checks which did or did not produce results, and select and unselect individual rule checks. Unselecting individual checks is useful if a particular check gives false errors when run on a limited area.");
MGCAddSnippet(66, "The Recipe editor dialog box includes controls to create, copy, save, and edit a check selection recipe for Calibre RealTime. ");
MGCAddSnippet(67, "Calibre RealTime Custom is integrated with Pyxis Layout. Calibre RealTime Custom integrates flat Calibre nmDRC with supported layout design tools so that Calibre nmDRC can be run directly from the design tool. ");
MGCAddSnippet(68, "Some files and setup actions are required to start and run Calibre RealTime with the Pyxis Layout editor.");
MGCAddSnippet(69, "The Calibre RealTime client in Pyxis Layout requires the use of a technology layer map to translate Pyxis Layout processes to GDS layers and datatypes. ");
MGCAddSnippet(70, "Design kits have a file containing the technology layer map within their technology configuration. The layer map is automatically loaded when the design kit is used and is available for use by the Calibre RealTime client. ");
MGCAddSnippet(71, "If you do not have a design kit or need to create a layer map manually, you can do so with the AMPLE Function $set_tech_layermap().");
MGCAddSnippet(72, "The AMPLE function $set_tech_layermap() is used to manually create a layer map when a layer map is not included in the design kit. ");
MGCAddSnippet(73, "Some files and setup actions are required in order to invoke Pyxis Layout with Calibre RealTime.");
MGCAddSnippet(74, "After Pyxis Layout is open, you enable the Calibre RealTime integrated toolbar and place it in the Pyxis Layout display.");
MGCAddSnippet(75, "Calibre RealTime in Pyxis Layout uses a standard Calibre nmDRC rule file. Check recipes control which checks in the rule file are executed during the Calibre RealTime run. ");
MGCAddSnippet(76, "You can edit existing check selection recipes or create new user-defined check recipes. You can create new recipes from scratch or you can copy existing user-defined or built-in recipes to create new ones. Custom recipes can be deleted when no longer needed. Built-in recipes may not be deleted.");
MGCAddSnippet(77, "Calibre RealTime is controlled through the toolbar and several dialog boxes.");
MGCAddSnippet(78, "The Calibre RealTime integrated toolbar in Pyxis Layout has selections for run control, highlight control, and option settings. ");
MGCAddSnippet(79, "The run controls are located on the far left-hand side of the Calibre RealTime integrated toolbar.");
MGCAddSnippet(80, "The highlight controls are located on the middle section of the Calibre RealTime integrated toolbar. ");
MGCAddSnippet(81, "The option controls are located on the right-hand side of the Calibre RealTime integrated toolbar. ");
MGCAddSnippet(82, "Use the Calibre Options dialog box to specify the Calibre rule file, the check recipe, and other options. ");
MGCAddSnippet(83, "The Calibre RealTime Recipe Editor edits a check selection recipe. There are two different views to toggle between in the dialog box: basic editing and advanced editing. The basic editing view enables you to perform very basic edits to RealTime DRC run recipes. The advanced editing view gives you precise control over the check types and which specific checks to include or exclude for any particular DRC run.");
MGCAddSnippet(84, "Keyboard shortcuts, or hotkeys, are available for many functions in Calibre RealTime for Pyxis Layout. ");
MGCAddSnippet(85, "Calibre RealTime Custom is integrated to Synopsys Laker3. Calibre RealTime Custom integrates flat Calibre nmDRC with supported layout design tools so that Calibre nmDRC can be run directly from the design tool.");
MGCAddSnippet(86, "The current release of Calibre RealTime is supported for certain version and platform combinations for Synopsys Laker. ");
MGCAddSnippet(87, "Certain steps are required to start and run Calibre RealTime with Synopsys Laker3.");
MGCAddSnippet(88, "Invoking Synopsys Laker with Calibre RealTime adds the Calibre RealTime integrated toolbar to the design window.");
MGCAddSnippet(89, "A run configuration in Calibre RealTime is the set of options and input files for a run. You can define multiple run configurations with different options (such as the rule file, check recipe and other options), then quickly switch between different run configurations. You can run with one configuration (single mode) or run multiple configurations in sequence (serial mode). ");
MGCAddSnippet(90, "Calibre RealTime uses a standard Calibre nmDRC rule file. Check recipes control which rule checks are executed during the Calibre RealTime run.");
MGCAddSnippet(91, "In window mode, Calibre RealTime runs checks on the geometries visible in the Laker window, plus a halo around the region. The specified check recipe selects the checks that are executed. All Calibre RealTime nmDRC runs are performed in flat mode.");
MGCAddSnippet(92, "In Run on Edit mode, Calibre nmDRC runs automatically after any design edit. Calibre is run on the region of the design edit plus a halo region around the area; the specified check recipe selects the checks that are executed. All Calibre RealTime nmDRC runs are performed in flat mode.");
MGCAddSnippet(93, "There are several points to keep in mind when you use Edit-In-Place (EIP) to fix errors found with Calibre RealTime.");
MGCAddSnippet(94, "The Calibre RealTime integrated toolbar and the Calibre RealTime Options dialog box provide the controls and settings you need to run Calibre RealTime. ");
MGCAddSnippet(95, "The Calibre RealTime integrated toolbar includes controls to start a DRC run, highlight results, and open the Calibre RealTime Options dialog box. The toolbar also includes option settings for run control and highlighting. ");
MGCAddSnippet(96, "The Calibre RealTime Options dialog box specifies the Calibre rule file, the check recipe, and other options. The settings in the Calibre RealTime Options dialog box are saved in the Calibre RealTime configuration file. ");
MGCAddSnippet(97, "You can customize the database read process by specifying layer map and object map files. You can also specify the number of vertices in the polygon used to approximate a circle or ellipse.");
MGCAddSnippet(98, "You can use automatic layer mapping based on the technology file or specify a custom layer map. ");
MGCAddSnippet(99, "You can define a custom object map file in Calibre RealTime for Synopsys Laker. ");
MGCAddSnippet(100, "Calibre RealTime approximates circles and ellipses found in Synopsys Laker databases as polygons. By default, Calibre RealTime uses a 20 point polygon to approximate an ellipse or circle.");
MGCAddSnippet(101, "Several Tcl commands are available to help you configure Calibre RealTime from within the Synopsys Laker environment. ");
MGCAddSnippet(102, "You must add some code to your $HOME/.lakerenv file in order to enable Calibre RealTime. You must also set an environment variable to specify the location of the Calibre software tree.");
MGCAddSnippet(103, "Calibre RealTime settings are saved in the Calibre RealTime configuration file. The configuration file is saved automatically and named .realtime.cfg; the file is saved in your $HOME directory by default.");
MGCAddSnippet(104, "Several keyboard shortcuts are defined in Calibre RealTime for Synopsys Laker, and others can be enabled if desired. ");
MGCAddSnippet(105, "You can define custom keyboard shortcuts for Calibre RealTime. Several default keyboard shortcuts are defined, along with option user-defined keyboard shortcuts which can be enabled. ");
MGCAddSnippet(106, "Calibre RealTime Custom is integrated with Synopsys Custom Compiler. Calibre RealTime Custom integrates flat Calibre nmDRC with supported layout design tools so that Calibre nmDRC can be run directly from the design tool.");
MGCAddSnippet(107, "Requirements for tool versions, input files, and environment variables must be met in order to run Calibre RealTime in Synopsys Custom Compiler. ");
MGCAddSnippet(108, "Certain requirements for design tool versions, layer map files, and environment variables must be met to run Calibre RealTime in Synopsys Custom Compiler. ");
MGCAddSnippet(109, "The Calibre integration to Synopsys Custom Compiler requires a Tcl script to be loaded. ");
MGCAddSnippet(110, "The support of Calibre RealTime Custom in Synopsys Custom Compiler depends on the Calibre release and the Synopsys version.");
MGCAddSnippet(111, "A layer map file is required to map the Synopsys Custom Compiler layer objects to GDS layers and datatypes for layout export. The layer map file is specified in the Calibre RealTime Options dialog box.");
MGCAddSnippet(112, "Several tasks are required to start and run Calibre RealTime in Synopsys Custom Compiler.");
MGCAddSnippet(113, "After invoking Synopsys Custom Compiler with Calibre RealTime, you see the Calibre RealTime integrated toolbar.");
MGCAddSnippet(114, "A run configuration in Calibre RealTime is the set of options and input files for a run. You can define multiple run configurations with different options (such as the rule file, check recipe and other options), then quickly switch between different run configurations. You can run with one configuration (single mode) or run multiple configurations in sequence (serial mode). ");
MGCAddSnippet(115, "Calibre RealTime uses a standard Calibre nmDRC rule file. The check recipe controls which checks in the rule file are executed during the Calibre RealTime run.");
MGCAddSnippet(116, "Calibre RealTime runs checks on the geometries visible in the Synopsys Custom Compiler window plus a halo around the region. The specified check recipe selects the checks that are executed. All Calibre RealTime DRC runs are performed in flat mode.");
MGCAddSnippet(117, "The Calibre RealTime integrated toolbar includes controls to start a DRC run, highlight results, and open the Calibre RealTime Options dialog box. The toolbar also includes option settings for run control and highlighting.");
MGCAddSnippet(118, "A set of standard keyboard shortcuts are provided for Calibre RealTime Custom with Synopsys Custom Compiler.");
MGCAddSnippet(119, "You can define custom keyboard shortcuts for Calibre RealTime Custom. The Calibre installation provides a file of standard keyboard shortcuts. ");
MGCAddSnippet(120, "Calibre RealTime Custom is integrated with the OpenAccess version of Cadence Virtuoso. Calibre RealTime Custom integrates flat Calibre nmDRC with supported layout design tools so that Calibre nmDRC can be run directly from the design tool.");
MGCAddSnippet(121, "Requirements for tool versions, input files, and environment variables must be met in order to run Calibre RealTime with Cadence Virtuoso. ");
MGCAddSnippet(122, "Certain requirements for design tool versions, layer map files, and environment variables must be met to run Calibre RealTime for Cadence Virtuoso. ");
MGCAddSnippet(123, "Several environment variable settings are needed for Calibre RealTime operation with Cadence Virtuoso. ");
MGCAddSnippet(124, "The support of Calibre RealTime with Cadence Virtuoso depends on the Calibre release and the Cadence version. ");
MGCAddSnippet(125, "When using Calibre RealTime for Cadence Virtuoso, you can set the environment variable MGC_REALTIME_HOME to specify a version for Calibre RealTime that is newer than the Calibre version set with CALIBRE_HOME. This is useful if you want to run the latest version of Calibre RealTime while leaving CALIBRE_HOME pointing to an earlier, qualified version of Calibre. ");
MGCAddSnippet(126, "Several tasks are required to start and run Calibre RealTime with Cadence Virtuoso OA.");
MGCAddSnippet(127, "After invoking the Cadence Virtuoso editor with Calibre RealTime, you see the Calibre RealTime integrated toolbar.");
MGCAddSnippet(128, "A run configuration in Calibre RealTime is the set of options and input files for a run. You can define multiple run configurations with different options (such as the rule file, check recipe and other options), then quickly switch between different run configurations. You can run with one configuration (single mode) or run multiple configurations in sequence (serial mode). ");
MGCAddSnippet(129, "Calibre RealTime uses a standard Calibre nmDRC rule file. The check recipe controls which checks in the rule file are executed during the Calibre RealTime run.");
MGCAddSnippet(130, "Calibre RealTime runs checks on the geometries specified by the DRC run type. The specified check recipe selects the checks that are executed. All Calibre RealTime nmDRC runs are performed in flat mode.");
MGCAddSnippet(131, "You can start a batch Calibre run from Calibre RealTime if the design window contains more than three million polygons. The controls for starting a batch run are on the Batch tab in the Calibre RealTime Options dialog box. ");
MGCAddSnippet(132, "You can use a Check Text Override (CTO) file to assign the highlight color and layer visibility for results according to the rule check. The Check Text Override file is specified in the Calibre RealTime Options dialog box. ");
MGCAddSnippet(133, "There are several points to keep in mind when you do a descend or ascend in Cadence Virtuoso or use Edit-In-Place (EIP) to fix errors found with Calibre RealTime.");
MGCAddSnippet(134, "You can set an environment variable to instruct Calibre RealTime to delete the MentorMessengerLib and MentorObserverLib entries from the cds.lib file if Calibre RealTime is disabled when you exit Cadence Virtuoso. ");
MGCAddSnippet(135, "You set the environment variable MGC_REALTIME_FORCED_LIB_LOCATION to specify a non-default cds.lib in which to save the Mentor libraries. Calibre creates libraries that are used internally and it can be useful to save these in a different location than your default cds.lib. ");
MGCAddSnippet(136, "The Calibre RealTime integrated toolbar and the Calibre RealTime Options dialog box provide the controls and settings you need to run Calibre RealTime. Some frequently accessed options are provided in the DRC Run and Highlight Options dropdown menu. ");
MGCAddSnippet(137, "The Calibre RealTime integrated toolbar includes controls to start a DRC run, highlight results, and open the Calibre RealTime Options dialog box. The toolbar also includes option settings for run control and highlighting.");
MGCAddSnippet(138, "The Calibre RealTime integration adds the RealTime DRC menu item the Calibre menu in the main Cadence Virtuoso menu bar. ");
MGCAddSnippet(139, "Certain frequently used Calibre RealTime settings are available in the DRC Run and Highlight Options dropdown menu.");
MGCAddSnippet(140, "The Calibre RealTime Options dialog box specifies the Calibre rule file, the check recipe, and other options. The settings in the Calibre RealTime Options dialog box are saved in the Calibre RealTime Configuration File. ");
MGCAddSnippet(141, "The Batch tab has settings for controlling a Calibre batch run started from Calibre RealTime. You can set the number of polygons in the layout window that triggers a batch run, and execution and licensing options. ");
MGCAddSnippet(142, "You can customize the database read process by specifying layer map and object map files. You can also specify the number of vertices in the polygon used to approximate a circle or ellipse.");
MGCAddSnippet(143, "A layer map file is required to map the Cadence Virtuoso layer and purpose pairs to GDS layers and datatypes for layout export. The layer map file can be read automatically from the technology library, specified with an environment variable, or specified in the Calibre RealTime Options dialog box.");
MGCAddSnippet(144, "You specify the layer map file in the Calibre RealTime Options dialog box. ");
MGCAddSnippet(145, "You can define a custom object map file in Calibre RealTime for Cadence Virtuoso. ");
MGCAddSnippet(146, "Calibre RealTime approximates circles, ellipses, arcs, and donuts found in Cadence Virtuoso databases as polygons. By default, Calibre RealTime uses a 360 point polygon to approximate these shapes.");
MGCAddSnippet(147, "Multi-patterning is supported in Calibre RealTime Custom in Cadence Virtuoso. ");
MGCAddSnippet(148, "Several SKILL commands are available to help you configure Calibre RealTime from within the Cadence environment. ");
MGCAddSnippet(149, "You can read and define the settings in the Calibre RealTime options dialog box using SKILL commands. The commands enable you to dynamically set up the Calibre RealTime configuration based on the current library, cell, and view. ");
