MGCAddSnippet(169, "SKILL procedure that instructs Calibre RealTime to highlight a single error at a time when error markers overlap. Subsequent clicks on the same error marker cycle through the errors. By default (without calling this command) all errors are highlighted at once. ");
MGCAddSnippet(170, "Calibre RealTime provides commands to get and set environment variables from the Cadence command interface. ");
