MGCAddSnippet(175, "Calibre RealTime settings are saved in the Calibre RealTime configuration file. The configuration file is saved automatically and named .realtime.cfg; the file is saved in your $HOME directory by default.");
MGCAddSnippet(176, "A set of standard keyboard shortcuts are provided for Calibre RealTime with Cadence Virtuoso.");
MGCAddSnippet(177, "You can define custom keyboard shortcuts for Calibre RealTime. The Calibre installation provides a file of standard keyboard shortcuts. ");
MGCAddSnippet(178, "Some troubleshooting tips are provided to address common problems in Calibre RealTime with Cadence Virtuoso. ");
MGCAddSnippet(179, "Calibre RealTime Custom is integrated with Calibre DESIGNrev. Calibre RealTime Custom integrates flat Calibre nmDRC with supported layout design tools so that Calibre nmDRC can be run directly from the design tool.");
MGCAddSnippet(180, "Several requirements must be met in order to run Calibre RealTime with Calibre DESIGNrev.");
MGCAddSnippet(181, "Several actions are required to start and run Calibre RealTime with Calibre DESIGNrev.");
MGCAddSnippet(182, "After you start the Calibre DESIGNrev layout viewer with Calibre RealTime you see the Calibre RealTime integrated toolbar.");
MGCAddSnippet(183, "Calibre RealTime uses a standard Calibre nmDRC rule file. Check recipes control which checks in the rule file are executed during the Calibre RealTime run.");
MGCAddSnippet(184, "In window, area, or cell mode, Calibre RealTime runs checks on the geometries specified by the DRC run type. The specified check recipe selects the checks that are executed. All Calibre RealTime nmDRC runs are performed in flat mode.");
MGCAddSnippet(185, "In Run on Edit mode, Calibre nmDRC runs automatically after any design edit. Calibre is run on the region of the design edit plus a halo region around the area; the specified check recipe selects the checks that are executed. All Calibre RealTime nmDRC runs are performed in flat mode.");
MGCAddSnippet(186, "You can use a Check Text Override (CTO) File to assign the highlight color and layer visibility for results according to the rule check. ");
MGCAddSnippet(187, "Result tooltips include the layer information, check name, check text, and optionally the check definition. ");
MGCAddSnippet(188, "The Calibre RealTime integrated toolbar and the Calibre RealTime Options dialog box provide the controls and settings you need to run Calibre RealTime. Some frequently accessed options are provided in the DRC Run and Highlight Options dropdown menu. ");
MGCAddSnippet(189, "The Calibre RealTime integrated toolbar includes controls to start a DRC run, highlight results, and open the Calibre RealTime Options dialog box. The toolbar also includes option settings for run control and highlighting.");
MGCAddSnippet(190, "The Calibre RealTime integration adds the RealTime menu to the Verification menu in the main Calibre DESIGNrev menu bar. ");
MGCAddSnippet(191, "Certain frequently used Calibre RealTime settings are available in the DRC Run and Highlight Options dropdown menu.");
MGCAddSnippet(192, "The Calibre RealTime Options dialog box specifies the Calibre rule file, the check recipe, and other options. The settings in the Calibre RealTime Options dialog box are saved in the Calibre RealTime Configuration file. ");
MGCAddSnippet(193, "You may need to set database read options, such as layer mapping and how to read text objects, when you use Calibre RealTime with Calibre DESIGNrev. All database read options may be set within the Calibre DESIGNrev environment. You can also specify a layer map file in the Calibre RealTime Options dialog box. ");
MGCAddSnippet(194, "You can provide a layer map file in Calibre RealTime for Calibre DESIGNrev. ");
MGCAddSnippet(195, "Several Tcl commands are available to help you configure Calibre RealTime from within the Calibre DESIGNrev environment. ");
MGCAddSnippet(196, "Calibre RealTime settings are saved in the Calibre RealTime configuration file. The configuration file is saved automatically and named .realtime.cfg; the file is saved in your $HOME directory by default.");
MGCAddSnippet(197, "The F12 keyboard shortcut is defined by default to start a Calibre RealTime run on the current design window. Other keyboard shortcuts can be defined if desired, using the keyprefs file for Calibre DESIGNrev. ");
MGCAddSnippet(198, "Calibre RealTime Custom reads a number of environment variables that specify run-time behavior.");
MGCAddSnippet(199, "Calibre RealTime uses a number of environment variables to specify run-time behavior. Some environment variables are used by all tools and other environment variables are tool-specific.");
MGCAddSnippet(200, "Calibre RealTime Custom provides limited support for some SVRF statements, particularly statements involving text objects and cell hierarchy. Some statements are supported with a limited syntax or for limited applications, some statements are not supported by all Calibre RealTime Custom integrations, and some statements are not supported at all.");
MGCAddSnippet(201, "Some SVRF statements have limited syntax support in Calibre RealTime or are not supported by all Calibre RealTime integrations. ");
MGCAddSnippet(202, "Calibre RealTime provides the following support for the Density statement. ");
MGCAddSnippet(203, "Calibre RealTime provides the following support for the DFM Copy statement. ");
MGCAddSnippet(204, "Calibre RealTime provides the following support for the DFM Text statement. ");
MGCAddSnippet(205, "Calibre RealTime provides the following support for the Expand Text statement. ");
MGCAddSnippet(206, "Calibre RealTime provides the following support for the Extent Cell statement. ");
MGCAddSnippet(207, "Calibre RealTime provides the following support for the Extent Drawn statement. ");
MGCAddSnippet(208, "Calibre RealTime provides the following support for the Inside Cell statement. ");
MGCAddSnippet(209, "Calibre RealTime provides the following support for the Layout Text statement. ");
MGCAddSnippet(210, "Calibre RealTime provides the following support for the Layout Rename Text statement. ");
MGCAddSnippet(211, "Calibre RealTime provides the following support for the Not Inside Cell statement. ");
MGCAddSnippet(212, "Calibre RealTime provides the following support for the Not With Text statement. ");
MGCAddSnippet(213, "Calibre RealTime provides the following support for the With Text statement. ");
MGCAddSnippet(214, "Details on open source and third-party software that may be included with this product are available in the <your_software_installation_location>/legal directory.");

